<tr><th width="94" align="center" 
bgcolor="#eeeeee"><font size="2" color="#343434">◇　カラー</font></th>
<td width="274" bgcolor="#ffffff"><font color="#454545" size="2">Denim</font></td></tr><tr>
<th width="94" align="center" bgcolor="#eeeeee"><font size="2" 
color="#343434">◇　商　品</font></th>
<td width="274" bgcolor="#ffffff"><font size="2" color="#454545">
今人気のデニム素材のソファーは男女問わずでおしゃれでスタイリッシュ。<br>
アメリカンな空間にもぴったり合わせやすいデザイン椅子です。<br>
もちろん、シンプルなお部屋に持ってこればデニムソファーが生えますし大人空間に。<br>
木製のインテリアとの相性もよく、観葉植物なんかとも相性がいいです。<br>
ボリュームのある厚めのアームが重厚感のあるソファです。深めのBOX型なのでゆったりと座れます。<br>
カフェやショップのインテリアとしても話題性が合ってお勧めのジーンズソファです。

  </font></td></tr><tr><th width="94" align="center" bgcolor="#eeeeee">
<font size="2" color="#343434">◇　ご注意</font></th><td width="274" bgcolor="#ffffff"><p><font size="2" color="#454545">

  <font size="2" color="red">※商品はメーカー他店舗との共有在庫のため、ご注文を賜っても、商品がご用意できない場合がございます。その場合は
    ご連絡させて頂き、キャンセル処理させて頂きます。<br><br>
    ◆こちらの商品は大型荷物扱いとなります。◆<br>
平日配送となります。<br>
<br>
当店では日付指定は承れません。倉庫出荷後
【配達前・事前連絡】にて運送会社とお客様で
配送日付を調整頂くことになります。<br><br>
購入前に玄関先までのお届けとなりますので
入口に入るサイズ・通路を通るか等
必ずご確認ください。（特に完成形テーブル・ソファー）<br>
家に入らないなどの理由での返品は賜れません。
予めご了承ください。<br>

</font></font><font size="2" color="#454545"><br />
    <br>
    ※掲載画像は、出来る限り実物に近づけておりますが、ご使用の環境や設定により実際の商品と色味が異なる場合がございます。<br /><br>
    ※生産時期により色味やパーツの仕様が変わる場合がございます。</font></p>
  <p><font size="2" color="#454545">※天然木を使用しております、木肌もそれぞれ違います、色味の違いなどもあることもございますが良品とさせていただいております。<br />
    <br>
    ※当店で直送品以外の商品を複数購入される場合、
    2箇所からの発送（当店・メーカー倉庫）となります。
    配達日時・配送業者が異なります。予めご了承下さい。
    送料に関しましては当店規定どおりです。<br>
    <br>
    ※配送の日時指定ができかねます。お客様の方で運送会社へ
    直接ご連絡頂けます様お願いいたします。
    <br><br>
    ※北海道の方は+3000円程(大型それぞれ異なります)・別途送料がかかります。<br><br>
    送料無料の商品でも返信メールにてプラス加算させて頂きます。<br>
    沖縄・離島の方は大型メーカー直送商品はご注文を賜る
    ことが出来ません。予めご了承下さい。
    どうしても欲しい場合は送料など一度ご相談下さい<br><br>
    ※メーカー直送商品となりますので返品・交換は一切対応
    できません。破損商品などに関しては対応致します。
    但し、アンティーク加工・独自塗装などを施していますので
    キズ・ムラもあることもございます→
    良品扱いとなります。<br>
