     <p>※送料無料のアイテムです！※
     <p>◆ポップでカジュアルなスタイルのインテリアはもちろん、ガレージスタイル・アメリカンビンテージやサーフスタイルとも相性が良くこだわりのお部屋造りの主役にもなりうる、存在感のあるソファ。１点でお部屋の印象を変える事ができるアイテムです。
     <p>◆おしゃれの定番にしてもはや必須といえる生地アイテム「デニム」。
     <p>◆使い込んだような風合いに仕上げられたユーズド加工を施してあり、使い始めから味のある雰囲気！
     <p>◆男性・女性を問わず使え、お部屋に馴染みやすい仕上がりです♪
     <p>◆そのままソファとして使用しても良し、脚を取り外してローソファ/座椅子として使用しても良し！生活やお部屋に合わせて、2WAYでお使いいただく事が出来ます♪
     <p>◆１４段ものリクライニング仕様で快適なくつろぎリラックスライフ♪</td>
